import React, { useState, useEffect } from "react";

const Health = () => {
  const [items, setItems] = useState([]);

  const addItem = item => {
    items.push(item);
    setItems(items);
  };

  useEffect(() => {
    return () => {};
  }, []);

  return <input type="button" onClick={() => addItem("this")} />;
};

export default Health;
